var book = {
	"name": "အၫမူၭ",
	"numChapters": 9,
	"chapters": {
		"1": {
			"1": "<sup>1</sup> ၦလၧအအီၪဝ့ၫလၧတံၫကိအၫအၡၩ ယိၥိၪအကျၩ စအၫမူၭအလူ လၧအဒၪဘၪလၧအံၫစရ့လၭအဂဲးအ ကၠီၪ့လၧယုဒၫအစဎွၩ အၧၭဇဲအၫ အမုနံၩလဖၪအ ဖၧၩ့,ဒဲလၧအံၫစရ့လၭအစဎွၩ, စယိအၭအဖိၪခွၫစယ့ၫ ရဘိအၫ့အမုနံၩလဖၪအဖၧၩ့ လၧဂၪ့ခိၪလချႃၭဝၭဒံၭ ဘၪနံၫနံၪ့လီၫ.",
			"2": "<sup>2</sup> တၭအဝ့ၫနီၪစံၭဝ့ၫဒၪ, ယဟိဝၩယုၩ့ထၪ့ဆၧလၧ ဇံအိၫ့အလီၩ့ ဒဲမၩၥီၫထၪ့အလူလၧယရုစလံၫ့အဖၧၩ့ တၭး ၦယိၥိၪအဆၧဒုၭအၪ့အဆၪ အလးလဖၪနီၪ မိ ၥုၪ့အုၭၥၭအုၭတၭ, ကၫမလၭအဒၩ့ခိၪလၩ့ယံၭခွံၬဝ့ၫ လီၫ.",
			"3": "<sup>3</sup> ယဟိဝၩစံၭဘဲၫယီၩ, လၧဒမၭစကၧၭအမၩမၪဆၧ ၥၧၫ့ဘျၩ့အကၠီၩ့ ဒဲလၧလံဘျၩ့အကၠီၩ့နီၪ ယမၩကဒၩ ထဲၩ့ဆၧနီၪအ့ၬ. အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪထးဂံလအၭ",
			"4": "<sup>4</sup> လၧနိၪထၭထးဘုၪလီၫ.- ယမိအၪ့မၧၫ့လၩ့မ့ၪဖိးလၧ စဟၭဇအ့လၭအဂံၪ့ဖၧၩ့လၧအမိအၪ့ခွံၬ စဘံၪ့ဟဒၭ",
			"5": "<sup>5</sup> အနီးလဖၪလီၫ.- ယမိမၩခါဆ့ဒမၭစကၧၭအနိၪဘီၩ့, ဒဲဒၪ့ထ့ၬခွံၬၦအီၪဝ့ၫ လၧခိၪလီၩ့ဆူၭအၫဝံၫ့အဖၧၩ့, ဒဲ ၦလၧအဖီၪ့ထၬအနိၪထိၭစဎွၩ လၧဘံၭၥအံဒံၫ့တၭ, ၦစံရအၫဖိၪမိလ့ၩကဲၪဎီးလၧကၧၫအဖၧၩ့, ယဟိဝၩ စံၭဝ့ၫဒၪ.",
			"6": "<sup>6</sup> ယဟိဝၩစံၭဘဲၫယီၩ, လၧဂၫဇၫအမၩမၪဆၧၥၧၫ့ ဘျၩ့အကၠီၩ့, ဒဲလၧလံဘျၩ့အကၠီၩ့နီၪ, ယမၩကဒၩ ထဲၩ့ဆၧနီၪအ့ၬ. အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪဆိၬထၪ့ခွံၬ ၦအၪ့မၧၫ့ဎီးဝ့ၫထီးအလူၬဘဲၫၥိၭ အမိဖ့ၪလၫ့ခွံၬအဝ့ၫ",
			"7": "<sup>7</sup> ၥံၪလၧအံဒၧၫ့လီၫ.- ယမိအၪ့မၧၫ့လၩ့မ့ၪလၧဂၫဇၫ အခိၪဒၧၩ့အဖၫ့ခိၪ တၭ, မိအၪ့ခွံၬ အနီးလဖၪလီၫ.",
			"8": "<sup>8</sup> ယမိဒၪ့ထ့ၬခွံၬ ၦအီၪဝ့ၫလၧအၭစဒီၭ, ဒဲၦလၧအဖီၪ့ ထၬနိၪထိၭစဎွၩ လၧအၭၡကံလၫ့တၭ, ယမိကၠၪထဲၩ့ ယစူၪထၫ့ဒၩ အ့ၭကြၧၫ့တၭ, ၦဖလံၡၫဖိၪလၧအအီၪ လၩ့ထးနီၪမိဂၭဂီၩ့, ကဆါယဟိဝၩစံၭဝ့ၫဒၪ.",
			"9": "<sup>9</sup> ယဟိဝၩစံၭဘဲၫယီၩ, လၧတဲအၫမၩမၪဆၧၥၧၫ့ဘျၩ့ အကၠီၩ့, ဒဲလၧလံဘျၩ့အကၠီၩ့နီၪ ယမၩကဒၩထဲၩ့ဆၧ နီၪအ့ၬ. အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪဖ့ၪလၫ့ခွံၬ ၦအၪ့မၧၫ့ ဎီးထီးအလူၬ လၧအံဒၧၫ့အစူၪဖၧၩ့တၭ, နၪ့ထၪ့ထဲၩ့",
			"10": "<sup>10</sup> အထၧၫ့ဖုဝဲအဆၧအုၩ့လၩ့အ့ၬ.- ယမိအၪ့မၧၫ့လၩ့မ့ၪ လၧတဲအၫအခိၪဒၧၩ့အဖၫ့ခိၪတၭ, မိအၪ့ခွံၬအနီးလ ဖၪလီၫ.",
			"11": "<sup>11</sup> ယဟိဝၩစံၭဘဲၫယီၩ, လၧအံဒၧၫ့မၩမၪဆၧၥၧၫ့ဘျၩ့ အကၠီၩ့, ဒဲလၧလံဘျၩ့အကၠီၩ့နီၪ ယမၩကဒၩထဲၩ့ဆၧ နီၪအ့ၬ. အဂဲးဘဲၫယီၩ အဝ့ၫလီၩ့အထၧၫ့ဖုဝဲလၧနၭ တၭ,ခွံၬၡိၭခွံၬအဆၧယၫ့ၥၭထီးအလူၬတၭ, အၥၭ ထၪ့အဲၪ့ၡၫ့ဆၧလထံၪဎးလဘီၩ့ဎးတၭ, အီၪက့ၪအ",
			"12": "<sup>12</sup> ၥၭထၪ့လၩ့ဆိၩလၩ့ကၠၪလီၫ.- ယမိအၪ့မၧၫ့လၩ့မ့ၪ လၧတံမၫ့အဖၧၩ့တၭ, မိအၪ့ခွံၬဘီၭဇရၫအနီးလဖၪ လီၫ.",
			"13": "<sup>13</sup> ယဟိဝၩစံၭဘဲၫယီၩ, လၧၦအၫမၧၫ့ဖိၪအမၩမၪ ဆၧၥၧၫ့ဘျၩ့အကၠီၩ့, ဒဲလၧလံဘျၩ့အကၠီၩ့နီၪ ယမၩ ကဒၩထဲၩ့ဆၧနီၪအ့ၬ. အဂဲးဘဲၫယီၩၦမုၪဘၪဆဲၫ့လၧ ဂံလအၭလၧအဒၧၩ့ထၪ့ဝ့ၫလဖၪ အဂူၭဖိၫ့နီၪအဝ့ၫၥံၪ ဎွ့ၭဖၭဘဲၫၥိၭအမိမၩလဲထၪ့ အခးအနဲၩ့ထံၭလီၫ.",
			"14": "<sup>14</sup> ယမိဆူၭခဲၩထၪ့မ့ၪလၧရၭဘၫအခိၪဒၧၩ့ အဖၫ့ခိၪတၭ, မိအၪ့ခွံၬအနီးလဖၪ အီၪလၧဆၧကိၭၡၭထၪ့ လၧဒုၭ ၥုၭအမုနံၩအဖၧၩ့, ဒဲလဖုၬလၧလံၩၥဝံၭအမုလနံၩအ",
			"15": "<sup>15</sup> ဖၧၩ့လီၫ.- အစဎွၩမိလ့ၩကဲၪဎီး, အဝ့ၫဒၪ, ဒဲအၦဒိၪ ဖၭဒိၪလဖၪလစီၪ့ဎး, ယဟိဝၩစံၭဝ့ၫဒၪ."
		},
		"2": {
			"1": "<sup>1</sup> ယဟိဝၩစံၭဘဲၫယီၩ, လၧမိအၭမၩမၪဆၧၥၧၫ့ဘျၩ့ အကၠီၩ့, ဒဲလၧလံဘျၩ့အကၠီၩ့နီၪ,ယမၩကဒၩထဲၩ့ဆၧ နီၪအ့ၬ. အဂဲးဘဲၫယီၩအဝ့ၫဆူၭထၪ့ခွံၬ အံဒၧၫ့အစဎွၩ",
			"2": "<sup>2</sup> အဎွံၪအနၧၩ့မၩကဲၪထၪ့ဘၧၩ့နီၪလီၫ.- ယမိအၪ့မၧၫ့ လၩ့မ့ၪလၧမိအၭအဖၧၩ့တၭ, မိအၪ့ခွံၬကရ့အီၭအနီး လဖၪတၭ, မိအၭမိၥံၫဝ့ၫလၧဆၧတုၩ့ထၪ့တုၩ့လၩ့အ",
			"3": "<sup>3</sup> ဖၧၩ့ထီးဆၧကိၭၡၭထၪ့ လၧခွ့ၩအၥီၫလီၫ.- ယမိဒၪ့ ထ့ၬခွံၬၦစ့ၩရၫ့ခွးလဂၩ လၧအကျၩတၭ, ယမိမၩၥံၫ အၦဒိၪဖၭဒိၪထီးအလူၬဆ့လၧအဝ့ၫဒၪအၥိၭ, ယဟိ ဝၩစံၭဝ့ၫဒၪ.",
			"4": "<sup>4</sup> ယဟိဝၩ စံၭဘဲၫယီၩ, လၧယုဒၫအမၩမၪဆၧၥၧၫ့ ဘျၩ့အကၠီၩ့, ဒဲလံဘျၩ့အကၠီၩ့နီၪ, ယမၩကဒၩထဲၩ့ ဆၧနီၪအ့ၬ. အဂဲးဘဲၫယီၩအဝ့ၫၥံၪလဒူၩလယၪ့ဘၪ ယဟိဝၩ အဆၧၥီၪ့ဆၧၥၫ့, ဒဲလထီးန့ဘၪအဆၧမၪ လူၬ,ဒဲဆၧဂၩ့ဆၧဖၪ့လၧအဖါလဖၪ လ့ၩဖိၬအခဲၫ့နီၪ",
			"5": "<sup>5</sup> အၪ့မၧၫ့အမၩမၪဆၧလီၫ.- ယမိအၪ့မၧၫ့လၩ့မ့ၪလၧ ယုဒၫအကျၩတၭ, မိအၪ့ခွံၬယရုစလံၫ့အနီးလဖၪလီၫ.",
			"6": "<sup>6</sup> ယဟိဝၩစံၭဘဲၫယီၩ, လၧအံၫစရ့လၭအမၩမၪဆၧ ၥၧၫ့ဘျၩ့အကၠီၩ့, ဒဲလၧလံဘျၩ့အကၠီၩ့နီၪ, ယမၩက ဒၩထဲၩ့ဆၧနီၪအ့ၬ. အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪအၪ့ဆၫ ခွံၬၦတီၩၦလီၩ့လၧစ့ၩအဂး, ဒဲၦၡၪ့ဖိၪလၧခၪ့ဖံၭလ",
			"7": "<sup>7</sup> ဆီၫ့အဂးလီၫ.- ၦလၧအလီၫ့ကီၩ့ဂၪ့ခိၪအမုၬလၧၦၡၪ့ ဖိၪအခိၪဎွံၪအလီၩ့တၭ, ဘိၭကဲၪ့ၦဘၪၡၪ့ဘၪနၭအ ဖၧၩ့ၥၭတၭ, ၦလဂၩဒဲအဖါလဂၩလ့ၩနုၬလၧၦမုၪနၩ့ လဂၩဎးအအီၪ ဘဲၫၥိၭအမိမၩဘၪၥၭလိၪယမံၩ့ဆံၫ့",
			"8": "<sup>8</sup> ဎံၪလီၫ.- အဝ့ၫၥံၪအီၪက့ၪလၩ့အနၫ့ဆါဒၪဝ့ၫလၧဆၧ ပီၫ့လၩ့အကီၩ့အၥိၭအဖၫ့ခိၪ လၧကယဲဆၧလုလးအ နဲၩ့ထံၭတၭအီၩၦလၧအဘၪလိၭစ့ၩ အစဘံၭထံၫလၧ အယွၩလဖၪအဂံၪ့ဖၧၩ့လီၫ.",
			"9": "<sup>9</sup> လါနၫ့တၭ, ယဝ့ၫဒၪယီၩယမၩဂၭဂီၩ့ယူၭၦအၫမိၫ ဖိၪလၧအဝ့ၫၥံၪအမ့ၬယၫ လၧအထၪ့ထီၫဝ့ၫဘဲၫၥံၪ့ၡိၫ အ့ရ့ၭအၥိၭ, ဒဲဆီၪ့ဝ့ၫဘဲၫ ၥံၪ့ထိၭဖၫ အၥိၭနီၪလီၫ. မွဲလါနၫ့တၭ, ယမၩဂၭဂီၩ့ယူၭ အဆၧၥၪလၧထၭလ",
			"10": "<sup>10</sup> ခီၫဒဲအဝံလၧလၬလခီၫလီၫ.- ယဝ့ၫဒၪယီၩ ယဒုၭစဲၪ့ ထၪ့ခွံၬနၥံၪ လၧခးအံဇံၭအဖၧၩ့, ဒဲၥိၫ့နၥံၪ လၧၡါမု နၧၫ့ဖၫအနံၪ့လံဆံၫအထးဖၧၩ့ ဘဲၫၥိၭယမိမၩန့ၦအၫ",
			"11": "<sup>11</sup> မိၫဖိၪအခးလီၫ.- ယဒုၭကဲၪထၪ့နၥံၪ အဖိၪခွၫလဖၪ လၧမီၪဒဲနၥံၪအဖိၪၥၪခွၫလဖၪ လၧၦနၭစရ့ဖိၪလီၫ. ၦအံၫစရ့လၭဖိၪၥံၪဧ့, မွဲဘဲၫနီၪၥိၭ, မွဲအ့ၬဧၪ. ယဟိ",
			"12": "<sup>12</sup> ဝၩစံၭဝ့ၫဒၪ.- လါနၫ့တၭနၥံၪဖ့ၪအီၩၦနၭစရ့ၭဖိၪလၧ စဘံၭထံၫ,ဒဲမၪလူၬမီၪလဖၪတၭနၥံၪစံၭ, ထီးချဲၩ့ဆၧ",
			"13": "<sup>13</sup> လၧမီၪအချိၬလဂ့ၩ.- ယိခွါ,ယမိဆၪ့လၩ့နၥံၪဘဲၫလဲၪ့ လၧအဎွ့ၩလၧဘုၪထူနီၪ ဘၪဆၧဆၪ့လၩ့ဝ့ၫအၥိၭနီၪ",
			"14": "<sup>14</sup> လီၫ.- ဆၧစဲၪ့ဖျိၭဖျဲၪနီၪမိဂၭဂီၩ့ဝ့ၫ, ၦအဆီၪ့ဒုၭဆီၪ့ ထၪ့အဂဲးအဘၭအ့ၬ. ၦလၧအစီၩ့အမၩ့အီၪနီၪ မၩ",
			"15": "<sup>15</sup> ဖီၩ့ဖျ့ၭအၥၭအ့ၬ.- ၦလၧအဖီၪ့ထၬ ချံၪၥံၪဖျါၥံၪနီၪ, ဆၧၫ့ထုၪ့ဝ့ၫအ့ၬ. ၦလၧအစဲၪ့လၧအခၪ့ဖျဲၪနီၪ ဖီၩ့ဖျ့ၭ",
			"16": "<sup>16</sup> ဝ့ၫအ့ၬ. ၦလၧအထူၬကၥ့ၪ မၩဖီၩ့ဖျ့ၭအၥၭအ့ၬ.- ၦ လၧအအီၪက့ၪအၥၭဒူၩ လၧၦအဆီၪ့အကျၩနီၪ မိစဲၪ့ ထၪ့အီၪဘိၪ့လၧမုနံၩနီၪ, ယဟိဝၩစံၭဝ့ၫဒၪ."
		},
		"3": {
			"1": "<sup>1</sup> ၦအံၫစရ့လၭဖိၪၥံၪဧ့, ခိၭနၪဆၧချဲၩ့ယီၩလၧယဟိ ဝၩချဲၩ့ထၫ့ဒုၪဒၩနၥံၪ, ထၫ့ဒၩၦလဒီၪ့ထၧၫ့ဒီၪ့ယၫလၧ ယဒုၭစဲၪ့ထၪ့ခွံၬ လၧခးအံဇံၭအဖၧၩ့တၭ, စံၭဝ့ၫဒၪ.",
			"2": "<sup>2</sup> လၧၦအဒီၪ့လၧဂၪ့ခိၪချိၫ့ ထီးအလူၬအကျၩနီၪ ယၥ့ၪ ယၫယူၭန့ၫနၥံၪလီၫ. မၩအၥၭဘဲၫနီၪတၭ, ယမိစ့ၩရၫ့ နၥံၪလၧနၥံၪအဆၧအၧၩ့ ထီးအလူၬအကၠီၩ့လီၫ.",
			"3": "<sup>3</sup> ၦနံၫဂၩအၥၭအ့ၪလမီၪ့ဎီၩ့ဘၪတၭ, မိလ့ၩဆၧလ",
			"4": "<sup>4</sup> စီၪ့ဎးနီၪဘၪမိၥ့ၪဆ့ဧၪ.- ဆၧအၪ့ဂူၬန့အ့ၪလအီၪဘၪ တၭဆၬလၥၧၫ့မိယုၩ့ဆၧဆ့ဧၪ, ဆၬလၥၧၫ့ဖိၪအ့ၪလ",
			"5": "<sup>5</sup> ဖီၪ့န့ဘၪဆၧတၭ, မိကိၭထၪ့လၧအဖၧၩ့နီၪဆ့ဧၪ.- ခုၩ အ့ၪလအီၪဘၪလၧဂၪ့ခိၪအဖၫ့ခိၪတၭ, ထိၪနီၪမိဘၪခုၩ ဆ့ဧၪ.ဖျံၩခွၩ့အ့ၪလဘၪန့ဘၪဆၧနးမံၩ့နီၪ, မွဲအမိၥွံၭ",
			"6": "<sup>6</sup> ထံၬအၥၭဆ့ဧၪ.- ၦအ့ၪအူၪထၪ့ခွ့ၩလၧဒိၩ့ဖၧၩ့တၭ, ၦၡၩၥၭမဲၪဆၧအ့ၬဧၪ. ယဟိဝၩအ့ၪလမၩဘၪတၭ,",
			"7": "<sup>7</sup> ဆၧအၧၩ့မိအီၪလၧဒိၩ့ဖၧၩ့ဆ့ဧၪ.- ကဆါယဟိဝၩအ့ၪ လနဲၪဖျီၪထၪ့ဘၪ အဆၧကိၪ့ဆၧဖၭ လၧအခ့ၫအၡၩ",
			"8": "<sup>8</sup> မီၪလဖၪတၭ, မွဲအမၩဘၪဆၧနးမံၩ့အ့ၬ.- ဆၬလၥၧၫ့ ယုၩ့ယူၭဆၧတၭ, မွဲပလၫလၥၭမဲၪဘၪလဂၩလဲၪ. က ဆါယဟိဝၩချဲၩ့ယူၭဆၧယူၭတၭ, ၦလၧအလချဲၩ့ ဘၪဆၧလၧမီၪအချိၬနီၪ, မွဲပလၫလဂၩလဲၪ.",
			"9": "<sup>9</sup> ကိၭထၪ့ဆၧလၧအၭစဒီၭအနီးလဖၪအဖၧၩ့, ဒဲလၧ ခးအံဇံၭအနီးလဖၪအဖၧၩ့တၭ,စံၭ, အီၪကိၩ့အီၪကီၪ့ လၧစမ့ရအၫအခိၪလီၩ့ထိၩ့ချိၬ, ဒဲယိဆၧတုၩ့ထၪ့တုၩ့ လၩ့ဖၭဒိၪလၧအဖၧၩ့, ဒဲၦဘၪဆၧမၩအၧၩ့ဝ့ၫလၧအ",
			"10": "<sup>10</sup> ကျၩဆံၭ.- အဂဲးဘဲၫယီၩ ၦလၧအအီၪက့ၪကီၪ့ဆၧ အၪ့ဂူၬဆီၪ့, ဒဲဆၧမၩန့ဆီၪ့လၧအနီးဖၧၩ့နီၪၥ့ၪယၫအ",
			"11": "<sup>11</sup> မၩတီၩဆၧအ့ၬ. ယဟိဝၩစံၭဝ့ၫဒၪ.- မၩအၥၭဘဲၫနီၪ တၭ,ကဆါယဟိဝၩစံၭဘဲၫယီၩ, ဆၧအဒုၪအဒၩမိ အီၪဝၬဖီၩ့ထံၫၥံၪခးၥံၪတၭ, မိမၩဆါလၩ့နဂဲးနဘၭ, ဒဲ",
			"12": "<sup>12</sup> မိမၩန့ဆီၪ့နနီးလဖၪလီၫ.- ယဟိဝၩစံၭဘဲၫယီၩ, ဘဲၫ ၦယိၥိၪထုၭထၪ့န့ခၪ့နံၫခီၫ, အ့ၪလမွဲဘၪနါလကဲၩ့လၧ ဆၬလၥၧၫ့အနိၭဖၧၩ့အၥိၭနီၪ, ဆၧမိထုၭထၪ့အံၫစရ့ လၭလၧအအီၪဝ့ၫ လၧစမ့ရအၫလၧလးမံၫအနိၪ့,ဒဲလၧ",
			"13": "<sup>13</sup> ဒမၭစကၧၭ လၧစပွဲအနိၪ့နီၪ ဘဲၫနီၪၥိၭလီၫ.- ခိၭနၪ တၭ,ထိးနၥံၪအၥၭထၫ့ဒၩစယၫကူၭအၡၩဂံၪ့ဖိၪ, က",
			"14": "<sup>14</sup> ဆါ,ယဟိဝၩဆၧၥုၭမုခမျၧးအယွၩ စံၭဝ့ၫဒၪ.- မွဲမၬ, လၧမုလနံၩနီၪ လၧယမိစ့ၩရၫ့အံၫစရ့လၭ လၧအဆၧ မၪအကၠီၩ့တၭ, ယမိစ့ၩရၫ့ဘ့ၥလၭအဆၧလုလးတၭ, ဆၧမိဒၪ့ထ့ၬခွံၬ ဆၧလုလးအနိၩ့တၭမိလၩ့ထ့ၬလၧဂၪ့",
			"15": "<sup>15</sup> ခိၪအဖၫ့ခိၪလီၫ.- ယမိထးဆၧဂီးအထီအဂံၪ့ဒဲဆၧခိ အထီအဂံၪ့တၭ, ဂံၪ့ကဆၫ့မဲၪမိဂၭဂီၩ့တၭ, ဂံၪ့ဖၭဒိၪ လဖၪမိဂၭဂီၩ့ထီးအလူၬ, ယဟိဝၩစံၭဝ့ၫဒၪ."
		},
		"4": {
			"1": "<sup>1</sup> ခိၭနၪဆၧချဲၩ့ယီၩဆံၭး ဘၫၡၫ့အချီမိလၧအအီၪဝ့ၫ လၧစမ့ရအၫအခိၪလီၩ့ လၧအမၩအၧၩ့ၦၡၪ့ဖိၪလၧအ မၩလၩ့ဘျ့ၭ ၦလၧအဘၪၡၪ့ဘၪနၭ,လၧအစံၭအက",
			"2": "<sup>2</sup> ဆါလဖၪ,ဂဲၫဆိၬ,အီၩၡီၩ့ဆၧဆံၭ.- ကဆါယဟိဝၩ ဆိၪလၩ့အၥၭ လၧအဆၧဆံၫ့ဎံၪအကၠီၩ့တၭ, စံၭဝ့ၫ ယိခွါ,မုနံၩလဖၪမိဂဲၫဘၪနၥံၪ ထီးဆၧမိထုၭထၪ့ခွံၬ နၥံၪလၧနိၪပုၭ, ဒဲနၥံၪအဆၨၩအဆၬ လၧခွ့ၩလဖၪ",
			"3": "<sup>3</sup> လီၫ.- နၥံၪမိစဲၪ့ထၪ့ခွံၬ လၧဆၧဘုၪ့ဖိး အလးဖၧၩ့, လဂၩတီၩလၧအမ့ၬယၫလဂၩတီၩလၧအမ့ၬယၫဆုၬ ဆုၬတၭ, ဆၧမိခွံၬၡိၭခွံၬနၥံၪ လၧနီးလဖၪအဖၧၩ့,ယ ဟိဝၩစံၭဝ့ၫဒၪ.",
			"4": "<sup>4</sup> ဂဲၫလၧဘ့ၥလၭတၭ, မၩမၪဆၧ, မၩအၪထၪ့ဆၧမၪ လၧဂံလဂၫလၭအဖၧၩ့တၭ, ဂဲၫဆိၬနၥံၪလုထၪ့ဆၧ ကိၭဂီၩဒ့ၭ, နၥံၪမၩဘိၪ့ဆံၫပိၩ့လပိၩ့ လၧၥၧၫ့နံၪ့လ",
			"5": "<sup>5</sup> ဘျၩ့ဆံၭ.- လုထၪ့ဆၧလုစံၭထၪ့အၪ့အူၭအီၪလၧကိၪ မံၪတၭ, ကိၭထၪ့ဆၧမၩဘိၪ့ဒၪဆၧနီၪ, ဒုၭနါဂၧၫ့ဆၧ ဆံၭ.အဂဲးဘဲၫယီၩ နၥံၪအဲၪဆၧဘဲၫနီၪၥိၭလီၫ. ၦအံၫ စရ့လၭဖိၪၥံၪဧ့, ကဆါယဟိဝၩစံၭဝ့ၫဒၪ.",
			"6": "<sup>6</sup> ယဖ့ၪလၫ့နၥံၪအမဲၪဆံၫ့ လၧနၥံၪအဒိၩ့ထီးအလူၬ အဖၧၩ့တၭ, လၧနၥံၪအနီးဖၧၩ့ ထီးအလူၬနီၪကိၪလ အီၪဘၪလါနၫ့တၭ, နၥံၪဂဲၫထဲၩ့ထဲၩ့လၧယအီၪအ့ၬ.",
			"7": "<sup>7</sup> ယဟိဝၩစံၭဝ့ၫဒၪ.- ဆၧကူၭဘုၪအထီလချႃၭဘၪဒံၭ ဘၪနီၪ, ယပဒၩ့ဆၧဆၧၩ့လၩ့လၩၥၧၫ့ဘံၪ့အထးဖၧၩ့ လါနၫ့တၭ, ယဒုၭဂဲၫဆၧၩ့လၩ့ဆၧလၧဒိၩ့လဖျိၪ့အဖၫ့ ခိၪတၭ, လၧဒိၩ့အဂူၫဂၩလဖျိၪ့ အဖၫ့ခိၪနီၪ, ယဒုၭ ဆၧၩ့လၩ့ဘၪအ့ၬ. ဆၧဂဲၫဆၧၩ့လၧဂၪ့ခိၪအဝၩ့အဖၫ့ ခိၪတၭ, လဝၩ့လၧဆၧလဂဲၫဆၧၩ့ဘၪလၧအဖၫ့ခိၪနီၪ",
			"8": "<sup>8</sup> ၥူၫထၪ့ဎဲၫ့ထၪ့ခွံၬဝ့ၫလီၫ.- ဒိၩ့နံၫဖျိၪ့ၥၧၫ့ဖျိၪ့စဲၪ့ဝ့ၫလၧ ဒိၩ့လဖျိၪ့ဎးဘဲၫၥိၭအမိအီၩထံၫတၭ, ဘျဲၩအီၩဝ့ၫအ့ၬ. မွဲလါနၫ့တၭ, နၥံၪဂဲၫထဲၩ့ထဲၩ့လၧယအီၪအ့ၬ. ယဟိ ဝၩစံၭဝ့ၫဒၪ.",
			"9": "<sup>9</sup> ယထးနၥံၪလၧလံၩခိမၩဆၫဘုၪၥံၪဂူၫၥံၪ, ဒဲနၫလ့ လီၫ. နၥံၪအကျိၭလဖၪ, ဒဲနၥံၪအစဘံၭမုအလး, ဒဲ နၥံၪအချိၪ့ဒိၩ့ၥၪ, ဒဲနၥံၪအၥံၪ့အလဲအိၫ့အၥၪနီၪထွ့အဲၪ့ ကျိၩဆၧအၪ့ခွံၬဝ့ၫလီၫ. လါနၫ့တၭ, နၥံၪဂဲၫထဲၩ့ထဲၩ့",
			"10": "<sup>10</sup> လၧယအီၪအ့ၬ. ယဟိဝၩစံၭဝ့ၫဒၪ.- ယအၪ့မၧၫ့လၩ့ ယူၭဆၧၥံၫချဲၫ့ လၧနၥံၪအကျၩ ဘဲၫလၧအံဇံၭအဖၧၩ့ အၥိၭနီၪ,နၥံၪအၡၩဖိၪၥၪခွၫလဖၪနီၪ ယမၩၥံၫအဝ့ၫ ၥံၪလၧနၭအီၪလၧနၥံၪအကၥ့ၪလၧၦဖီၪ့န့ဝ့ၫတၭ, ယ အၪ့မၧၫ့နၥံၪအတဲၩအလးနီၪ အဆၧနၧၩ့အုၪဂဲၫနုၬလၧ နၥံၪအနၫဖၧၩ့လီၫ. လါနၫ့တၭ, နၥံၪဂဲၫထဲၩ့ထဲၩ့လၧ",
			"11": "<sup>11</sup> ယအီၪအ့ၬ. ယဟိဝၩစံၭဝ့ၫဒၪ.- ယမၩဂၭဂီၩ့ခွံၬနၥံၪ လနၩ့နၩ့, ဘဲၫယွၩမၩဂၭဂီၩ့ခွံၬစီဒၧၫ့, ဒဲဂမိရၫအၥိၭ နီၪတၭ,ဆၧမၩနၥံၪဘဲၫမ့ၪအၧၩ့ဖၭ လၧဆၧဖျဲးန့ထၪ့ ခွံၬလၧမ့ၪကျၩအၥိၭနီၪး လါနၫ့တၭ,နၥံၪဂဲၫထဲၩ့ထဲၩ့",
			"12": "<sup>12</sup> လၧယအီၪအ့ၬ.ယဟိဝၩစံၭဝ့ၫဒၪ.- မၩအၥၭဘဲၫနီၪ တၭ,ယမိမၩနၧၩဘဲၫယီၩ, အံၫစရ့လၭဧ့, မွဲလၧယမိ မၩနၧၩဘဲၫယီၩအကၠီၩ့တၭ, တဲၩ့ဝဲၩနၥၭဘဲၫၥိၭနမိ",
			"13": "<sup>13</sup> ဒၪလိၬလၧနယွၩဆံၭ, အံၫစရ့လၭဧ့,- အဂဲးဘဲၫယီၩ, ယိခွါ,ၦလၧအမၩခိၪလီၩ့ထိၩ့ချိၬ ဒဲတဲၩ့လၩ့လံၩမု လဖၪတၭ, ၦၡၩဆီၫ့မီၪ့ဝ့ၫ ဘဲၫၥ့ၪလဲၪဘဲၫၥ့ၪလဲၪနီၪ, လီၩဘၪအဝ့ၫတၭ, အီၪက့ၪမုဂီၩလၧဆၧခံၭတၭ, စဲၪ့ ဝ့ၫလၧဂၪ့ခိၪအလးထၪ့ထီၫလဖၪအဖၫ့ခိၪနီၪ, ယဟိ ဝၩ,ဆၧၥုၭမုခမျၧးအယွၩနီၪ, မွဲအမံၩ့လီၫ."
		},
		"5": {
			"1": "<sup>1</sup> ခိၭနၪဆၧချဲၩ့ယီၩ, လၧယချဲၩ့လၧနၥံၪအဂဲး, ဂၪ့",
			"2": "<sup>2</sup> ဆၧယၧၩ့ဆၧ, အံၫစရ့လၭအၡၩဂံၪ့ဖိၪၥံၪဧ့,- အံၫစရ့ လၭအၡၩမုၪနၩ့ထၪ့လၩ့ထံၩဖါယူၭ, ဂဲထုၪ့လၧၩ့အ့ၬ. မံၫနၩ့ဝ့ၫလၧအခးဖၧၩ့ဒၪဝ့ၫအဖၫ့ခိၪနီၪ ဆၧဘိၭဂဲထုၪ့",
			"3": "<sup>3</sup> ဝ့ၫအီၪအ့ၬ.- အဂဲးဘဲၫယီၩ ကဆါယဟိဝၩ စံၭဘဲၫ ယီၩ,ဒိၩ့လၧအဒုၭစဲၪ့ထၪ့ၦလထီၫ့မိအီၪက့ၪလၩ့ထး ၦလယၩ, ဒဲဒိၩ့လၧအဒုၭစဲၪ့ထၪ့ ၦလယၩနီၪမိအီၪ က့ၪလၩ့ထးဆံၫဂၩ, လၧအံၫစရ့လၭ အၡၩဂံၪ့ဖိၪအ ဂးလီၫ.",
			"4": "<sup>4</sup> အဂဲးဘဲၫယီၩ ယဟိဝၩစံၭအံၫစရ့လၭအၡၩဂံၪ့ဖိၪ",
			"5": "<sup>5</sup> ဘဲၫယီၩ, အၪ့ဎၬယၧၩဆံၭး တၭနၥံၪမိမၧၫ့လီၫ.- ထီး အၪ့ဎၬဘ့ၥလၭလဂ့ၩ,ဒဲလ့ၩနုၬလၧဂံလဂၫလၭလဂ့ၩ, ဒဲလ့ၩခၫ့ဂၬဘံအၧၫၡံၫဘၫလဂ့ၩ. အဂဲးဘဲၫယီၩဂံလ ဂၫလၭမိလ့ၩကဲၪဎီးတၡါတၭ, ဘ့ၥလၭမိဘၪဆၧမၩ",
			"6": "<sup>6</sup> ဂၭဂီၩ့ဝ့ၫလီၫ.- အၪ့ဎၬယဟိဝၩဆံၭး တၭနၥံၪမိမၧၫ့ လီၫ. မိစဲၪ့တလဲးဘုၪ့ဖိးဘၪခိၬ ဆၧလၧစယိၥၭအဂံၪ့ ဖၧၩ့ဘဲၫမ့ၪအၥိၭတၭ, အၪ့ခွံၬဝ့ၫတၭး ၦမၩလၩ့ဖံၬဝ့ၫ အီၪလၧဘ့ၥလၭအဖၧၩ့အ့ၬ.",
			"7": "<sup>7</sup> နၥံၪဝ့ၫ နၥံၪအၪ့လဲၩခွံၬဆၧစ့ၩရၫ့လၧရီးခၥီၫ, ဒဲခွံၬ",
			"8": "<sup>8</sup> လၩ့ခွံၬဆၧတီၩဆၧလီၩ့ လၧဂၪ့ခိၪအဖၫ့ခိၪၥံၪဧ့,- အၪ့ ဎၬၦလၧအတဲၩ့ၡၪဒိၩ့မု, ဒဲအိၫရဲအၫ့, ဒဲအၪ့လဲၩဆၧ ၥံၫအလၩဒုၩ, လၧမုဂီၩ, ဒဲမၩခံၭလၩ့မုဆၫန့ၫဎီၩ့မု နၩ,လၧအကိၭန့မၫဆမံၭအထံၫ, ဒဲဂါလၩ့ဝ့ၫလၧဂၪ့",
			"9": "<sup>9</sup> ခိၪအဖၫ့ခိၪလဂၩနီၪဆံၭ. အမံၩ့မွဲယဟိဝၩနီၪး- ၦလၧ အဒုၭဘၪၡုၭၦအဆီၪ့လၧဆၧမၩဂၭဂီၩ့, ဒဲထိၬၥံၪထီၩ့ လၧဆၧဂၭဂီၩ့လီၫ.",
			"10": "<sup>10</sup> အဝ့ၫၥံၪနီၪၥၭဂဲၫ့ ၦလၧအအၪ့ၥီၪ့ဆၧလၧတရၫ့အ",
			"11": "<sup>11</sup> ဖၧၩ့တၭ, ၥၭလိၪၦလၧအချဲၩ့ဆၧတီၩလီၫ.- မၩအၥၭ ဘဲၫနီၪတၭ, မွဲနၥံၪယဲးထဲးလၩ့ၦၡၪ့ဖိၪယၬဖိၪ ဒဲမၩန့ ဘုၪၥံၪဂူၫၥံၪအခီၫ့တၭ, နၥံၪမၩဂံၪ့လၧလိးစိၩဖျၩအ ၥၭလါနၫ့တၭ,နၥံၪအီၪလၧအဖၧၩ့အ့ၬ. နၥံၪၥုၪ့စဘံၭ မုအလးလါနၫ့တၭ, နၥံၪအီၩဘၪစဘံၭထံၫလၧအဝ့ၫ",
			"12": "<sup>12</sup> ၥံၪဆ့အ့ၬ.- အဂဲးဘဲၫယီၩယၥ့ၪယၫနၥံၪအဆၧမၩမၪ နီၪအီၪအၪမံၩ့, ဒဲနၥံၪအဆၧဒဲၩဘၭနီၪလၧအမွဲအဒိၪ အယိၬလီၫ. နၥံၪမၩအၧၩ့ၦတီၩၦလီၩ့, ဒဲဒိၭန့လၬဆီၪ့ နီၪ,နၥံၪဘိၭကၠၪခွံၬၦၡၪ့ဖိၪယၬဖိၪ လၧတရၫ့အဖၧၩ့",
			"13": "<sup>13</sup> လီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ၦလၧအၥုၪ့ဆၭအၥၭဆၭ နီၪမိအီၪလၩ့မါပံၭ လၧဆၧအဆၧၫ့အထီဖၧၩ့နီၪလီၫ. အဂဲးဘဲၫယီၩမွဲဆၧအဆၧၫ့အထီအၧၩ့လီၫ.",
			"14": "<sup>14</sup> ဘဲၫၥိၭနၥံၪမိမၧၫ့တၭ, အၪ့ဎၬဆၧဂ့ၩဆံၭး ထီးအၪ့ ဎၬဆၧအၧၩ့လဂ့ၩ. ဆၧမိမၩအၥၭဘဲၫနီၪ, ယဟိဝၩ ဆၧၥုၭမုခမျၧးအယွၩ မိအီၪလၧနၥံၪအၥိၭ, ဘဲၫနၥံၪ",
			"15": "<sup>15</sup> စံၭအၥိၭနီၪလီၫ.- ၥၭဂဲၫ့ဆၧအၧၩ့, အဲၪဆၧဂ့ၩတၭ,ဒုၭ အီၪဂုးအီၪခၧၫ့ဆၧစ့ၩရၫ့တီၩ လၧတရၫ့အဖၧၩ့ဆံၭ. ဘၪလဘၪယဟိဝၩဆၧၥုၭမုခမျၧးအယွၩ မိဒုၭဘၪ ခိးဘၪတၩယိၥၭအၡၩ လၧအအီၪလၩ့ထးလဖၪလီၫ.",
			"16": "<sup>16</sup> မၩအၥၭဘဲၫနီၪတၭ, ယဟိဝၩဆၧၥုၭမုခမျၧးအယွၩ, ကဆါစံၭဘဲၫယီၩ, ၦမိဂၪ့အုၩဂၪ့ထိၬၥီၫထၪ့လၧဖၧၩ့ ၥၭထီးအလူၬအဖၧၩ့း ၦမိစံၭလၧဖၧၩ့ၥၭမုထီးအလူၬ အဖၧၩ့း အၩလါၬ အၩလါၬ တၭမိကိၭၦမၩကၩၥံၪလၧ ဂၪ့ခိၪဘဲၫၥိၭအမိဂၪ့အုၩဝ့ၫ, ဒဲၦလၧအဂၪ့ဆၧယၧၩ့ ဆၧၥ့ၪလဖၪနီၪ, ဘဲၫၥိၭအမိဂၪ့ဆၧယၧၩ့ဆၧၥီၫထၪ့",
			"17": "<sup>17</sup> လီၫ.- ကယဲစဘံၭမုအလးလဖၪအဖၧၩ့ထီးအလူၬနီၪ, ဂၪ့ကိၭၡၭဆၧမိအီၪဝ့ၫလီၫ. အဂဲးဘဲၫယီၩယလ့ၩခၫ့ ဂၬဆၧလၧနကျၩ, ယဟိဝၩစံၭဝ့ၫဒၪ.",
			"18": "<sup>18</sup> ၦလၧအဆိၫ့ဘၪ ယဟိဝၩအမုလနံၩၥံၪဧ့,နၥံၪဘၪ အၡၪ့လီၫ. မွဲအအီၪလၧနၥံၪအဂးဘဲၫၥ့ၪလဲၪ. ယဟိ",
			"19": "<sup>19</sup> ဝၩအမုနံၩနီၪမွဲဆၧခံၭတၭ, ဆၧဖၩ့အ့ၬ.- မၩအၥၭ ဘဲၫၦစဲၪ့ခွံၬလၧဆၬလၥၧၫ့လဒုၩ အမ့ၬယၫတၭ, ဖုၫ ထၫ့လဒုၩဒၪဘၪဝ့ၫအၥိၭနီၪး အ့ၪလမွဲဘၪဘိၩ, မၩ အၥၭဘဲၫအလ့ၩနုၬ လၧဂံၪ့ဖၧၩ့တၭ, မံၫနၩ့ဒံၩ့ခံၫ့ဒိၭ နဲၩ့အၥၭလၧဆၧဒီၪ့အလီၩ့တၭ, ဂူဖျၭဘၪဝ့ၫအၥိၭနီၪ လီၫ.",
			"20": "<sup>20</sup> ယဟိဝၩအမုလနံၩနီၪ မိမွဲဆၧခံၭတၭ, မွဲဆၧဖၩ့ အ့ၬ.ဆၧခံၭၥၧၫ့ဆၧဖၩ့အီၪ လၧအဖၧၩ့နးဆံၭအ့ၬနီၪ, မွဲအ့ၬဧၪ.",
			"21": "<sup>21</sup> နၥံၪမၩဘိၪ့အမုနံၩလဖၪနီၪ, ယၥၭဂဲၫ့အဝ့ၫၥံၪ,ယ ၥၭလိၪအဝ့ၫၥံၪတၭ, ဘၪယၥၭလၧနၥံၪအီၪကီၪ့အမု",
			"22": "<sup>22</sup> နံၩလဖၪအ့ၬ.- နၥံၪမၩဘိၪ့ယၧၩလၧဆၧလုမ့ၪ, ဒဲဆၧ မၩဘိၪ့ကိၪမုၬလါနၫ့တၭ,ဘၪယၥၭနးဆံၭအ့ၬ.ယယိ နၥံၪအဆၧလုမၩဘၪလိၬအိၭလိၬ လၧနၥံၪအဆၧဖိၪ",
			"23": "<sup>23</sup> ဆၧဎါအဘီၪ့နီၪဆ့အ့ၬ.- မၩန့ထၪ့ခွံၬနၥံၫကျံၩဆၧ အၥီၫလၧယအီၪဆံၭ. အဂဲးဘဲၫယီၩ နၥံၪအၥၫ့ထီး",
			"24": "<sup>24</sup> အၥီၫမုၬနီၪယခိၭနၪအ့ၬ.- မွဲဆၧစ့ၩရၫ့နီၪယွၩလၩ့ဘဲၫ ထံၫအၥိၭဒဲဆၧတီၩဆၧလီၩ့ဘဲၫထံၫမိၡါဖၭဒိၪအ",
			"25": "<sup>25</sup> ထံၫအၥိၭနီၪဆံၭ.- နၥံၪမၩဘိၪ့ယၧၩလၧဆၧလုဒဲဆၧ ဆၧမၩဘိၪ့ၥံၪလၧၡါမုနၧၫ့ဖၫအနံၪ့ လံဆံၫအထးဖၧၩ့နီၪ,",
			"26": "<sup>26</sup> မွဲအ့ၬဧၪး အံၫစရ့လၭအၡၩဂံၪ့ဖိၪၥံၪဧ့,- လါနၫ့တၭ, နၥံၪဆိၬနၥံၪအမိလီၭ ဒဲခဲအၧၩ့နၥံၪအယွၩလၧနၥံၪတဲၩ့",
			"27": "<sup>27</sup> လၧနၥံၪအဂးနီၪ, အၡၪလီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ယမိအၪ့မၧၫ့နၥံၪလ့ၩကဲၪဎီး လၧဒမၭစကၧၭ အဝါလ ခီၫ,ယဟိဝၩစံၭဝ့ၫဒၪ, အမံၩ့မွဲဆၧၥုၭမုခမျၧးအယွၩ လီၫ."
		},
		"6": {
			"1": "<sup>1</sup> ၦလၧအအီၪဒၪဆၧဘဲၫနီၪ လၧဇံအိၫ့အဖၧၩ့,ဒဲဒိၭ နဲၩ့အၥၭ လၧစမ့ရအၫအခိၪလီၩ့အလီၩ့, ၦအခိၪလၧ ၦဒိၪထုၬလဆၨၩအကျၩ လၧအံၫစရ့လၭအၡၩဂံၪ့ဖိၪ",
			"2": "<sup>2</sup> ဂဲၫလၧအအီၪလဖၪနီၪ, မွဲအဘၪအၡၪ့ဖီၩၬ- လ့ၩထီၩ့ လၧကၫလနၫတၭ,ယိဆံၭ. စဲၪ့ထၪ့ခွံၬ ထီးနီၪတၭ, လ့ၩလၧဟၫမၭဖၭဒိၪနီၪ, လ့ၩလၩ့ဆ့ ဖိးလၧဂၫၥၭ ဘၪဆဲၫ့လၧဖလံၫၡၫဖိၪနီၪဆံၭ. မွဲအဝ့ၫၥံၪဂ့ၩနဲၪ့ဒံၭ ဘၩ့ၥံၪမုးၥံၪနီၪဧၪ. အခးအနဲၩ့ထံၭလဖၪနီၪ, မွဲအလဲ",
			"3": "<sup>3</sup> နဲၪ့ဒံၭနၥံၪအနဲၩ့ထံၭဆ့ဧၪ.- ၦလၧအအီၪက့ၪယံၬဆၧ အၧၩ့အမုလနံၩ, ဒဲဒုၭၥုၭဘူၭဆၧမၩဆီၪ့ အလးဆၧၫ့",
			"4": "<sup>4</sup> နၩ့,- ၦလၧအမံၫလၧလးမံၫကဆၫ့မဲၪ, ဒဲစီၪ့ထၪ့အၥၭ လၧစပွဲခိၪ, ဒဲအၪ့ဆၧအဖိၪလၧၥိၪဒဲဘ့ၪအကျၩ ဒဲချီ",
			"5": "<sup>5</sup> ဖိၪလၧဖီၩ့ဖၧၩ့,- လၧအၥံၫကျံၩထၪ့ဆၧလၧၥၫ့ထီးအ ၥီၫ,ဒဲဆၧမၩၥီၫမုၬ လၧအဂးဒၪဝ့ၫဘဲၫစဒၫဝံၭအၥိၭ,",
			"6": "<sup>6</sup> လၧအအီၩစဘံၭထံၫလၧလိၫ့ဖၧၩ့, ဒဲဂုၪလၩ့အၥၭလၧ ၥိၪနၧၫ့မၧၫ့အဂ့ၩထုၬလါနၫ့တၭ, လၥၭအုၭဘၪလၧ စယိၥၭအဆၧၡၪ့ဆၧနၭအကၠီၩ့လဖၪနီၪ, ဘၪအၡၪ့ လီၫ.",
			"7": "<sup>7</sup> မၩအၥၭဘဲၫနီၪတၭ, ဘိၩ့နဲၪ့ယီၩအဝ့ၫၥံၪမိဘၪလ့ၩ ကဲၪဎီးလၧၦလၧအလ့ၩကဲၪဎီးအမ့ၬယၫတၭ, ၦလၧ အအီၪကီၪ့ဒဲကိၭထၪ့ လၧအၥၭထိၬလဒီၪ့နီၪ, မိစဲၪ့ထၪ့",
			"8": "<sup>8</sup> ဝ့ၫလီၫ.- ကဆါယဟိဝၩဆိၪလၩ့အၥၭလၧအနၫ့ဆါ ဒၪဝ့ၫအကၠီၩ့, ယဟိဝၩဆၧၥုၭမုခမျၧးအယွၩစံၭဝ့ၫဒၪ, ယၥၭလိၪယၫကူၭအဎံၫအလၩနီၪ, ယၥၭဂဲၫ့အနီးၥံၪ လီၫ.မၩအၥၭဘဲၫနီၪတၭ, ယမိဖ့ၪလၫ့ခွံၬဒိၩ့ၥံၪထၫ့ ၥံၪဒဲကယဲဆၧလၧအအီၪဝ့ၫလၧအဖၧၩ့လီၫ.",
			"9": "<sup>9</sup> ဆၧမိမၩအၥၭလၧၦဆံၫဂၩအ့ၪအီၪ လၧဂံၪ့လဖျိၪ့ဎး",
			"10": "<sup>10</sup> တၭ, မိၥံၫဝ့ၫဆ့လီၫ.- ၦၡၩအဘူၭအထံး,ၦလၧအဎူ လၩ့အဝ့ၫဒၪနီၪ,မိမၩန့ထၪ့အဝ့ၫတၭ, မိဂဲၫဆိၬခွံၬဝ့ၫ အဎွံၪလဖၪလၧဂံၪ့ဖၧၩ့တၭ, မိစံၭ, ၦအီၪလၧဂံၪ့ဖၧၩ့ လခီၫ,ၦၡၩအီၪဒံၭလၧနၥိၭဆ့ဧၪ. တၭအဝ့ၫမိစံၭ,အီၪ အ့ၬ.ထီးနီၪလဖၧၫ့ အဝ့ၫမိစံၭ, အီၪလၩ့မါပံၭဆံၭၬ",
			"11": "<sup>11</sup> အဂဲးဘဲၫယီၩ ပဎွံၩ့ဘၪယဟိဝၩအမံၩ့အ့ၬ.- အဂဲး ဘဲၫယီၩ,ယိခွါ, ယဟိဝၩမၪလူၬဆၧတၭ, မိထၪ့ဂံၪ့ဖၭ ဒိၪလၧဆၧဘုၪ့ဖိးလဖၪ, ဒဲဂံၪ့ဖိၪလၧဆၧထ့ဖၭလဖၪ လီၫ.",
			"12": "<sup>12</sup> ကၥ့ၪမိစဲၪ့ဆၧလၧလိးအလီၩ့ဆ့ဧၪ. ၦမိထဲၫဆၧထီး နီၪလၧချီဖၫဆ့ဧၪ. လါနၫ့တၭနၥံၪအၪ့လဲၩခွံၬဆၧစ့ၩ ရၫ့တၭ,ဒုၭကဲၪထၪ့ဆၧအစုၪ, ဒဲဆၧတီၩဆၧလီၩ့အၥၪ",
			"13": "<sup>13</sup> နီၪလၧရီးခၥီၫလီၫ.- နၥံၪၥၭထိၬလၧဆၧလမွဲဘၪဆၧ အဖၧၩ့,နၥံၪစံၭ,ပမၩန့နိၩ့လဖၪ လၧပဂးလၧပဂဲးပ",
			"14": "<sup>14</sup> ဘၭဒၪပဝ့ၫမွဲအ့ၬဧၪ.- လါနၫ့တၭ,ယိခွါ,အံၫစရ့လၭ အၡၩဂံၪ့ဖိၪၥံၪဧ့, ယမိထိၪဂဲၩ ၦလဆၨၩထၫ့ဒုၪဒၩန ၥံၪ,ဒဲမိမၩအၧၩ့နၥံၪလၧဆၧလ့ၩနုၬ လၧဟၫမၭဖိးလၧ ထံၫချိၬလၧၡါမုနၧၫ့ဖၫ, ယဟိဝၩဆၧၥုၭမုခမျၧးအယွၩ စံၭဝ့ၫဒၪ."
		},
		"7": {
			"1": "<sup>1</sup> ကဆါယဟိဝၩဒုၭနဲၪယၧၩဘဲၫယီၩ, ယိခွါ,အဝ့ၫ ဒုၭကဲၪထၪ့ထွ့ၥံၪလၧနၪ့ၥံၪ လၧခဲၫ့လၧအမဲၪထၪ့ၥၫ့နီၪ တၭး ယိခွါ, မွဲနၪ့ၥံၪမံၩ့ၥံၪလၧစဎွၩကူၭဆၧအလးခဲၫ့",
			"2": "<sup>2</sup> နီၪလီၫ.- ဆၧမၩအၥၭထီးအဝ့ၫၥံၪ အၪ့လူၬခွံၬဂၪ့ခိၪ အနၪ့ၥံၪမံၩ့ၥံၪတၭး ယစံၭ, မၩဖီၩ့ဖျ့ၭလါဆၧဆံၭ, ကဆါယဟိဝၩဧ့, ဘဲၫၥိၭအမိဆၧၫ့ထုၪ့တၭ, ယၫကူၭ နီၪ, မွဲပလၫလဂၩလဲၪး အဂဲးဘဲၫယီၩ မွဲအဆံၭလီၫ.",
			"3": "<sup>3</sup> ယဟိဝၩနီၫ့ယါလၩ့ထဲၩ့အၥၭ လၧဆၧနီၪလမံၩ့အကၠီၩ့ လီၫ.ဆၧနီၪမၩဘၪအၥၭအ့ၬ, ယဟိဝၩစံၭဝ့ၫဒၪ.",
			"4": "<sup>4</sup> ကဆါယဟိဝၩဒုၭနဲၩယၧၩဘဲၫယီၩ, ယိခွါ,ကဆါ ယဟိဝၩကိၭဆၧဘဲၫၥိၭဆၧမိလိၭခွးလၧမ့ၪ, ဒဲမ့ၪအၪ့",
			"5": "<sup>5</sup> ခွံၬထံၫယိၬဖၭဒိၪဒဲအၪ့ခွံၬဆၧအဂးလီၫ.- ထီးနီၪလ ဖၧၫ့ယစံၭ, ကဆါယဟိဝၩဧ့,ယအၪ့ကံၩ့အၪ့ယၫနၧၩ အီၪပထုၬလါဆံၭ. ဘဲၫၥိၭအမိဆၧၫ့ထုၪ့တၭ, ယၫကူၭ",
			"6": "<sup>6</sup> မွဲပလၫလဂၩလဲၪ.အဂဲးဘဲၫယီၩမွဲအဆံၭလီၫ.- ယဟိ ဝၩနီၫ့ယါလၩ့ထဲၩ့အၥၭ လၧဆၧနီၪလမံၩ့အကၠီၩ့လီၫ. ဆၧနီၪမၩဘၪအၥၭဆ့အ့ၬ, ကဆါယဟိဝၩစံၭဝ့ၫဒၪ.",
			"7": "<sup>7</sup> အဝ့ၫဒုၭနဲၪယၧၩဘဲၫယီၩ, ယိခွါ,ယဟိဝၩဆၧၫ့ ထုၪ့လၧဆၧအဒီၪ့အီၪထုၪ့လုၪ့အဖၫ့ခိၪနီၪ အီၪလၧပနီၫ့",
			"8": "<sup>8</sup> ဖျံၩလၧအစူၪဖၧၩ့လီၫ.- ယဟိဝၩစံၭယၧၩ,စအၫမူၭဧ့, မွဲနဒၪဘၪဆၧနီၪလမံၩ့လဲၪ. တၭယစံၭပနီၫ့ဖျံၩလဘီၩ့ လီၫ.ယဟိဝၩစံၭဝ့ၫဒၪ,ယိခွါ, ယမိအီၪက့ၪပနီၫ့ဖျံၩ လဘီၩ့လၧယၡၩခမျၧး အံၫစရ့လၭအကျၩလီၫ. ယ",
			"9": "<sup>9</sup> လ့ၩဖၬလၧၩ့အဝ့ၫၥံၪအ့ၬ.- အံစၭအလးထၪ့ထီၫလဖၪ မိအီၪယူတၭ,ဆၧမိမၩလူၬထူၬ အံၫစရ့လၭအလးဆံၫ့ ဎံၪလဖၪတၭ, ယမိဂဲထုၪ့ထၫ့ဒုၪဒၩ စယ့ၫရဘိအၫ့အ ၡၩဂံၪ့ဖိၪလၧနၭၥံၪဖၩ့ၥံၪလီၫ.",
			"10": "<sup>10</sup> ထီးနီၪလဖၧၫ့ ဘ့ၥလၭအၡၩလုဆၧစအၫမဇဲအၫ အၪ့မၧၫ့လၩ့ဆၧ လၧအံၫစရ့လၭအစဎွၩယ့ၫရဘိအၫ့ အအီၪတၭ, စံၭဝ့ၫဒၪ,စအၫမူၭဒုၭအုၩ့လၩ့ဆၧထၫ့ဒၩ နၧၩလၧအံၫစရ့လၭအၡၩဂံၪ့ဖိၪအကျၩလီၫ. ထံၫၥံၪ",
			"11": "<sup>11</sup> ခးၥံၪထိးဆၧၫ့အဆၧချဲၩ့ထီးအလူၬနီၪၥ့ၪအ့ၬ.- အဂဲး ဘဲၫယီၩစအၫမူၭစံၭဘဲၫယီၩ, စယ့ၫရဘိအၫ့မိဘၪၥံၫ လၧနၭတၭ, ဆၧမိဆိၬထၪ့ခွံၬအံၫစရ့လၭလၧအခးဒၪ",
			"12": "<sup>12</sup> ဝ့ၫအဖၧၩ့တၭ,ဆၧမိအၪ့မၧၫ့ဎီးဝ့ၫလီၫ.- တၭစအၫမဇဲ အၫစံၭစအၫမူၭ, မီၪလဂၩဧ့, စဲၪ့ထၪ့ခွံၬလ့ၩဖိးလၧ ခးယုဒၫအဖၧၩ့တၭ, အၪ့ကိၪထီးနီၪတၭ,ချဲၩ့ဆၧလၧ",
			"13": "<sup>13</sup> မီၪအချိၬထီးနီၪဆံၭ.- အ့ၪမွဲလၧဘ့ၥလၭအဖၧၩ့နီၪ ချဲၩ့လၧၩ့ဆၧလၧမီၪအချိၬလဂ့ၩ. အဂဲးဘဲၫယီၩမွဲစဎွၩ အလးဆံၫ့ဎံၪ, ဒဲစဎွၩအနီးလီၫ.",
			"14": "<sup>14</sup> စအၫမူၭချဲၩ့ဆၧၫ့ဆၧတၭ, စံၭစအၫမဇဲအၫ,ယမွဲ မီၪအ့ၬး ယမွဲမီၪအဖိၪခွၫဆ့အ့ၬး ယမွဲၦယိချီၥံၪ,ဒဲၦ",
			"15": "<sup>15</sup> အီၪက့ၪကီၪ့ကူၪအၥၪလီၫ.- လၧယဖိၬၥိၪဒဲဘ့ၪအခဲၫ့ နီၪ,ယဟိဝၩမၩန့ယၧၩတၭ, ယဟိဝၩစံၭယၧၩ,လ့ၩ ချဲၩ့ဆၧလၧမီၪအချိၬ လၧယၡၩခမျၧး အံၫစရ့လၭနီၪ ဆံၭ.",
			"16": "<sup>16</sup> မၩအၥၭဘဲၫနီၪတၭ, ဘိၩ့နဲၪ့ယီၩ ခိၭနၪယဟိဝၩ အလူဆံၭ. နစံၭ,ထီးချဲၩ့ဆၧလၧမီၪအချိၬထၫ့ဒၩအံၫ စရ့လၭဒဲဒုၭလၩ့ဆၩ့ ဆၧလၧအံစၭ အဂံၪ့အဖၫ့ခိၪ",
			"17": "<sup>17</sup> လဂ့ၩနီၪလီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ယဟိဝၩစံၭဘဲၫ ယီၩ,နမၫမိမၩဆၧလဲးဆၧဘျၪလၧဒိၩ့ဖၧၩ့, ဒဲနဖိၪခွၫ လဖၪဒဲနဖိၪမုၪလဖၪမိလၩ့ထံၩဖါလၧနၭ, နထံၫနခးမိ ဘၪဆၧအၪ့နၩ့ဖၭလၧဖျံၩတၭ,နမိၥံၫလၧခးလဆံၫ့ဘၪ လဘံၪ့အဖၧၩ့တၭ, ဆၧမိဆိၬထၪ့ခွံၬအံၫစရ့လၭလၧ ခးဖၧၩ့တၭ, ဆၧမိအၪ့မၧၫ့ဎီးဝ့ၫတၡါလီၫ."
		},
		"8": {
			"1": "<sup>1</sup> ကဆါယဟိဝၩဒုၭနဲၪယၧၩဘဲၫယီၩ, ယိခွါ,ဆၧၥၪ",
			"2": "<sup>2</sup> မံၫ့လနၬလီၫ.- အဝ့ၫစံၭယၧၩ, စအၫမူၭဧ့,နဒၪဘၪဆၧ နီၪလဲၪ. ယစံၭဆၧၥၪမံၫ့လနၬလီၫ. ထီးနီၪလဖၧၫ့ ယ ဟိဝၩစံၭယၧၩ, ဆၧအထုၬနီၪဘၪယၡၩခမျၧးအံၫစရ့",
			"3": "<sup>3</sup> လၭတၭ,ယလ့ၩဖၬလၧၩ့အဝ့ၫၥံၪအ့ၬ.- ဆၧလၧမုလ နံၩနီၪနီးၥံၪအၥံၫကျံၩဆၧနီၪ, မိကဲၪထၪ့ဆၧအိၩ့ယိၩ့, ကဆါယဟိဝၩစံၭဝ့ၫဒၪ. ၦအစွၪအီၪအၪစီၪ့တၭ, ခွံၬ ၡိၭခွံၬအဝ့ၫၥံၪ ထီးဒၪအလးလစီၪ့လါလါဆံၭၬ အီၪ လၩ့မါပံၭဆံၭၬ",
			"4": "<sup>4</sup> ခိၭနၪဆၧယီၩဆံၭ! ၦလၧအလီၩ့ၦဘၪၡၪ့ဘၪနၭ ဘဲၫၥိၭနၥံၪမိမၩဂၭဂီၩ့ ၦၡၪ့ဖိၪယၬဖိၪ လၧခးဖၧၩ့ၥံၪ",
			"5": "<sup>5</sup> ဧ့,ၦလၧအစံၭ,- ဘဲၫၥိၭပမိအၪ့ဆၫဘုၪၥံၪဂူၫၥံၪတၭ, လၩၥံၫအနံၩ မိဖီၩ့ခွံၬဆံၭယံၬခိၬလဲၪ. ဘဲၫၥိၭပမိဝဲ ထၪ့ဘုၪၥံၪဂူၫၥံၪအဖၫ့တၭ, မးၥံၫအနံၩနီၪမိဖီၩ့ခွံၬဆံၭ ယံၬခိၬလဲၪ. ၦလၧအမၩအ့ဖၭလၧအဆံၭး ဒဲၡက့လၭ လၧအဒိၪ,ဒဲမၩဆၧခံၫ့လၧအလတီၩဘၪ လၧအအၪ့",
			"6": "<sup>6</sup> လီၫဆၧနီၪ,- ဘဲၫၥိၭၦမိဎွ့ၩ ၦၡၪ့ဖိၪလၧစ့ၩ ဒဲၦဘၪ ၡၪ့ဘၪယၬလၧခၪ့ဖံၭလဆီၫ့, ဒဲအၪ့ဆၫခွံၬဘုၪအၥိၪ",
			"7": "<sup>7</sup> လီၫ.- ယဟိဝၩဆိၪလၩ့အၥၭ လၧယၫကူၭအဎံၫအ",
			"8": "<sup>8</sup> လၩအကၠီၩ့, ယၥၭနၪ့အမၩဆၧနးမံၩ့အ့ၬ.- ထံၫၥံၪခး ၥံၪမိဝၭၡိၩ့ၡိၬဝ့ၫလၧအဝ့ၫနီၪအကၠီၩ့, ဒဲၦလၧအအီၪ လၧအဖၧၩ့မိၥၭအုၭကိၭဂၩဒ့ၭနီၪ, မွဲအ့ၬဧၪ.မိထၪ့ဝ့ၫ ထၧၫ့ဘံၪ့ယၫ ဘဲၫထံၫမိၡါအၥိၭနီၪ, မွဲအ့ၬဧၪ. ဒဲဘၪ ဆၧနၫ့ထၪ့ခွံၬဒဲလၩ့ၥံၭခွံၬဘဲၫအံဇံၭ အထံၫမိၡါအၥိၭ",
			"9": "<sup>9</sup> နီၪ,မွဲအ့ၬဧၪ.- ဆၧမိမၩအၥၭလၧမုလနံၩနီၪ, ကဆါ ယဟိဝၩစံၭဝ့ၫဒၪ. ယမိဒုၭလၩ့နုၬမု လၧမုထုၪ့တၭ, ယမိဒုၭခံၭလၩ့န့ ထံၫၥံၪခးၥံၪ လၧမုဆၫလခီၫလီၫ.",
			"10": "<sup>10</sup> ယမိအၪ့မၧၫ့နၥံၪမၩဘိၪ့အမုနံၩလဖၪ ကဲၪထၪ့ဆၧၥုၪ့ အုၭၥၭအုၭ, ဒဲနၥံၪအဆၧၥံၫကျံၩနီၪလၧဂၪ့ဆၧယၧၩ့ ဆၧတၭ,ယမိဒုၭအီၪၦကိၭဂၩဒ့ၭ လၧရၧၬအဆၧယၬ လၧအယးဒံၩ့တၭ, ယမိဒုၭလိၩ့ကယဲၦအခိၪလဂၩလါ လါတၭ, ယမိအီၪက့ၪအဝ့ၫ ဘဲၫၦဂၪ့ဝ့ၫလၧအဖိၪခွၫ လဂၩဎးအဂးအၥိၭနီၪတၭ, ဆၧအထုၬနီၪဘဲၫမုလနံၩ လၧအဘၪဆၧနၭနၭလ့ၬအၥိၭနီၪလီၫ.",
			"11": "<sup>11</sup> ယိခွါ, ယဟိဝၩစံၭဝ့ၫဒၪ,မုနံၩလဖၪမိဘၪလၧယမိ အၪ့မၧၫ့လၩ့ဆၧၥၭဝံလၩ့ဒိၩ လၧထံၫၥံၪခးၥံၪအဖၧၩ့ လီၫ.ဆၧၥၭဝံလၩ့ဒိၩလၧကိၪမွဲဂ့ၩ, ဆၧၥၭဝံအၥၭ လၧထံၫမွဲဂ့ၩ, မွဲအ့ၬး အ့ၪမွဲဆၧၥၭဝံလၩ့ဒိၩလၧဆၧ",
			"12": "<sup>12</sup> နါဂၧၫ့ယဟိဝၩအလူအထၫလီၫ.- တၭၦမိစဲၪ့ဝံၩ့ဝၩ့ ဆၧလၧမၫဆမံၭလစီၪ့ ဖိးလၧမၫဆမံၭ လစီၪ့ဒၪတၭ, အဝ့ၫၥံၪမိစဲၪ့ဝံၩ့ဝၩ့ ဆၧလၧမုဖၩလခီၫဖိးလၧမုထၪ့လ ခီၫ,ဘဲၫၥိၭအမိအၪ့ဎၬ ယဟိဝၩအလူနီၪလါနၫ့တၭ,",
			"13": "<sup>13</sup> ဒၪန့ဝ့ၫအ့ၬ.-ဆၧလၧမုလနံၩနီၪ,ၦမုၪနၩ့အဎံၫအလၩ လဖၪ,ဒဲၦဖိၪၥၪခွၫၥံၪနီၪ မိလၩ့ဘဲၩလၧဆၧၥူၫအၥၭ",
			"14": "<sup>14</sup> လၧထံၫအကၠီၩ့လီၫ.- ၦလၧအဆိၪလၩ့အၥၭလၧစမ့ရ အၫအဆၧဒဲၩဘၭအကၠီၩ့တၭ, စံၭဝ့ၫဒၪ,စဒၫ့ဧ့,နယွၩ မၧၫ့ဝ့ၫ,ဒဲဘံအၧၫၡံၫဘၫအဖၧၩ့ၥၭမၧၫ့ဝ့ၫလဖၪနီၪ, မိ လၩ့ထံၩဖါဝ့ၫတၭ, ဂဲထုၪ့လၧၩ့အ့ၬ."
		},
		"9": {
			"1": "<sup>1</sup> ယဒၪဘၪယဟိဝၩဆၧၫ့ထုၪ့ လၧဆၧလုလးအနဲၩ့ ထံၭတၭ,စံၭဝ့ၫဒၪ, ဒိၪတရၫ့အခိၪဘဲၫၥိၭအထုၪ့ၥံၪမိ ဝၭဝ့ၫဆံၭ. မၩခါလၩ့ဘျ့ၭဝ့ၫ လၧၦထီးအလူၬအဖၫ့ ခိၪဆံၭ.ယမိမၩၥံၫအဆၨၩအဆၬလၧနၭလီၫ. ၦလၧ အစဲၪ့ဖျိၭဝ့ၫလၧအကျၩနီၪ, စဲၪ့ထၪ့ခွံၬဘၪအ့ၬ. ဒဲၦ",
			"2": "<sup>2</sup> လၧအမိစဲၪ့ဖီၩ့ဖျ့ၭနီၪ, ဖီၩ့ဖျ့ၭနးဂၩအ့ၬ.- အဝ့ၫၥံၪခုၪ့ ထီၩ့လၩ့ဝ့ၫလၧဖျႃဖၧၩ့လါနၫ့တၭ, ယစူၪမိမၩန့အဝ့ၫ ၥံၪထီးနီၪလီၫ. အ့ၪထၪ့, ထၪ့ဘၭမူၭခိၪလါနၫ့တၭ,ယ",
			"3": "<sup>3</sup> စူၪမိဖီၪ့န့အဝ့ၫၥံၪထီးနီၪလီၫ.- အ့ၪအီၪက့ၪၥူၪအၥၭ လၧကၫမလၭအဒၩ့ခိၪလါနၫ့တၭ, ယမိအၪ့ဎၬန့ဒဲမၩန့ ခွံၬအဝ့ၫၥံၪထီးနီၪလီၫ. အ့ၪအီၪက့ၪၥူၪခွံၬအၥၭလၧ မၫဆမံၭယိၬအဖၧၩ့လါနၫ့တၭ, ယမိမၪလူၬဂူၥံၪ, မိ",
			"4": "<sup>4</sup> အဲၪ့အဝ့ၫၥံၪလီၫ.- အ့ၪလ့ၩကဲၪဎီးလၧအဒုၪအဒၩအ မ့ၬယၫလါနၫ့တၭ, ယမိမၪလူၬနၭထီးနီၪတၭ, မိမၩ ၥံၫအဝ့ၫၥံၪလီၫ. ယမိကၠၪစိၩယမ့ၬၥၪလၧအဝ့ၫၥံၪအ လီၩ့လၧဆၧအၧၩ့အဂးတၭ, မွဲလၧဆၧဂ့ၩအဂးအ့ၬ.",
			"5": "<sup>5</sup> အဂဲးဘဲၫယီၩမွဲဝ့ၫလၧယဟိဝၩ ဆၧၥုၭမုခမျၧးအယွၩ လၧအထိၭဘၪဂၪ့ခိၪနီၪတၭ, ဖံၪထၪ့ခွံၬဝ့ၫဒဲကယဲၦ လၧအအီၪဝ့ၫလၧအချိၫ့ထီးအလူၬနီၪဂၪ့ဝ့ၫလီၫ. တၭ မိထၪ့ဝ့ၫထၧၫ့ဘံၪ့ယၫ ဘဲၫထံၫမိၡါလုၬဘံၭအၥိၭ, ဒဲ",
			"6": "<sup>6</sup> လၩ့ၥံၭခွံၬ, ဘဲၫခးအံဇံၭအထံၫမိၡါအၥိၭနီၪလီၫ.- ၦ လၧအတဲၩ့အဒူၭထၪ့ထီၫလၧမူၭခိၪ, ဒဲအီၪက့ၪလၩ့အ မူၭထံၭလၧဂၪ့ခိၪချိၫ့, ၦလၧအကိၭန့မၫဆမံၭထံၫနီၪ, ဒဲလူၫလၩ့ဝ့ၫလၧဂၪ့ခိၪချိၫ့နီၪ, အမံၩ့မွဲယဟိဝၩလီၫ.",
			"7": "<sup>7</sup> နၥံၪမွဲဘဲၫၦအံၫၥအိပၠၪဖိၪအၥိၭ လၧယဂး,မွဲအ့ၬ ဧၪ,ၦအံၫစရ့လၭဖိၪၥံၪဧ့း ယဟိဝၩစံၭဝ့ၫဒၪ. ယဒုၭ စဲၪ့ထၪ့အံၫစရ့လၭ လၧခးအံဇံၭအဖၧၩ့နီၪ, ဒဲၦဖလံ ၡၫဖိၪလၧကၭပတီၫအဖၧၩ့, ဒဲၦအစံရအၫဖိၪလၧကၧၫ",
			"8": "<sup>8</sup> နီၪ,မွဲအ့ၬဧၪ.- ယိခွါ,ကဆါယဟိဝၩကၠၪအမ့ၬၥၪလၧ ဆၧဒဲၩဘၭအဘၩ့အမုးအအီၪတၭ, စံၭဝ့ၫဒၪ,ယမိမၩ ဂၭဂီၩ့ခွံၬအဝ့ၫၥံၪလၧဂၪ့ခိၪချိၫ့နီၪး လါနၫ့တၭ, စယၫ ကူၭအဂံၪ့နီၪ ယမၩဂၭဂီၩ့လူၬထူၬဝ့ၫအ့ၬ. ယဟိဝၩ",
			"9": "<sup>9</sup> စံၭဝ့ၫဒၪ.- အဂဲးဘဲၫယီၩ,ယိခွါ, ယမိမၪလူၬဆၧတၭ, ဂုၦအံၫစရ့လၭဖိၪ လၧၦကိၭဆၨၩဒ့ၭအကျၩ, ဘဲၫၦ ဂုဘုၪၥံၪဂူၫၥံၪလၧချဲၩဖၧၩ့အၥိၭတၭ, ဘုၪလဖျိၪ့လၩ့",
			"10": "<sup>10</sup> ထ့ၬဘၪလၧဂၪ့ခိၪအဖၫ့ခိၪအ့ၬ.- အ့ၪမွဲကယဲၦဆၧဒဲၩ ဘၭဖိၪလၧယၡၩခမျၧးအကျၩ လၧအစံၭဝ့ၫ,ဆၧအၧၩ့ နီၪလီၩ့ချႃၭန့ပၧၩအ့ၬ, ထီးအလူၬလဖၪနီၪမိၥံၫဝ့ၫလၧ နၭလီၫ.",
			"11": "<sup>11</sup> ဆၧလၧမုလနံၩနီၪ ယမိဘိၭဆၧၫ့ထုၪ့စဒၫဝံၭအတဲၩ လၧအလၩ့ဎီးဝ့ၫတၭ, ယမိမၩဎွ့ၩအဆၧဘုၪ့ဖိးလဖၪ တၭ,ယမိမၩထၪ့ထဲၩ့ အဆၧလၩ့ဎီးနီၪ, ဒဲယမိတဲၩ့",
			"12": "<sup>12</sup> ထၪ့ထဲၩ့ဝ့ၫဘဲၫလၧမုနံၩလၧဖျိၩ့အၥိၭလီၫ.- ဘဲၫၥိၭ ဆၧမိန့ၥၫဆၧအီၪလၩ့ထးလၧအံဒၧၫ့, ဒဲကယဲၦဆၨၩ လၧဆၧဖျိၬဝ့ၫလၧယမံၩ့ ယဟိဝၩလၧအမၩဆၧယီၩ,",
			"13": "<sup>13</sup> စံၭဝ့ၫဒၪလီၫ.- ယိခွါ, ယဟိဝၩစံၭဝ့ၫဒၪ, မုနံၩလဖၪ မိဘၪလၧၦထဲၫဆၧမိချႃၭန့ ၦကူၭဆၧၥံၪ, ဒဲၦလၧအ ယဲးလၩ့စဘံၭၥၪနီၪ ၦလၧအဎွံၪဆၧချံၪ,ဒဲခိၪလီၩ့ထိၩ့ ချိၬမိဒုၭလၩ့ဆၩ့စဘံၭထံၫအၥၫ့တၭ, ဆၧစီၩ့ခိၪထီး",
			"14": "<sup>14</sup> အလူၬမိဖံၪထၪ့ခွံၬလီၫ.- ယမိဒုၭဂဲၫထဲၩ့ယၡၩခမျၧး အံၫစရ့လၭလၧအလ့ၩကဲၪဎီးတၭ, အဝ့ၫၥံၪမိတဲၩ့ထၪ့ ထဲၩ့ဒိၩ့အီၪယူလဖၪတၭ, မိအီၪဝ့ၫလၧအဖၧၩ့တၭ, မိၥုၪ့လၩ့စဘံၭမုအလးလဖၪ, ဒဲမိအီၩအစဘံၭထံၫ တၭ,မိမၩကျိၭလဖၪနီၪ, ဒဲမိအၪ့အဆၧၥၪလဖၪဆ့",
			"15": "<sup>15</sup> လီၫ.- အဂဲးဘဲၫယီၩ ယမိၥုၪ့အဝ့ၫၥံၪလၧအခးဒၪဝ့ၫ အဖၧၩ့တၭ, ဆၧထ့ၭထၪ့ခွံၬလၧၩ့အဝ့ၫၥံၪ လၧအခး လၧယဖ့ၪလၫ့ဝ့ၫနီၪ အဖၧၩ့အ့ၬ. ယဟိဝၩနယွၩ စံၭ ဝ့ၫဒၪ."
		}
	}
};
module.exports = book;